animal.description:
Oh, sweet Daytona, where do I begin! This precious girl was super lucky to be rescued at the right time! Sadly, she was owned by a man with 5 other shepherd/golden mixed dogs, and their owner passed away. All 6 of his dogs were well taken care of, healthy, and as sweet as can be! Daytona came in exactly 1 week before giving birth to 9 beautiful puppies. Then her job as a Mama started. For over 8 weeks, she cared for, fed, cleaned, and of course played with her puppies. She did a fantastic job raising all 9 puppies! Then they started to head to their homes. Now that her job as a mama has ended, it's time to worry about herself again! 

Daytona has awesome jumping skills and might even make a great agility dog. She can scale gates, no problem! She is housebroken, walks well on a leash, and is about 2 years old. 

Daytona LOVES other dogs and would really benefit from having another dog to show her how to enjoy the doggie life! At this point no kids in the home with her. 

If interested in Daytona feel free to email her foster samsfosters@yahoo.com or fill out an application.


Almost Home Foundation's adoption requirements:

(1) Be at least 21 years of age;
(2) Have the consent of all adults living in the household;
(3) Have approval from the residence owner;
(4) Have valid ID with current address;
(5) Be approved by Almost Home Foundation as a suitable adoptive home; and
(6) Live in the Greater Chicago Land area.
7) A copy of your lease (pet page) is required, and submitted with your application

*** Please note that Almost Home Foundation accepts only cash or checks for adoption fees; we do not accept debit or credit cards. ***
